function servicetask17(attempt, message) {
	
	var ProtheusServiceProvider = ServiceManager.getServiceInstance("WSORCFLUIG");	    																  
    var ProtheusServiceLocator = ProtheusServiceProvider.instantiate("br.com.protheus.WSORCFLUIG");
    var ProtheusService = ProtheusServiceLocator.getWSORCFLUIGSOAP();
    
    
    var locator = ProtheusServiceProvider.instantiate('br.com.protheus.ObjectFactory');
	var _a = locator.createITENSLIST(); //_a é um VETORREGINCOS
	var _c = locator.createARRAYOFLISTA(); //_c é um ARRAYOFSTREG
	var _b = _c.getLISTA(); //b eh um java.util.List<STREG>
	
	var indice = 0;
	var campos1 = hAPI.getCardData(getValue("WKNumProces"));
	var contador1 = campos1.keySet().iterator();
	while (contador1.hasNext()) {
		
		var id1 = contador1.next();
		
		//pega a quantidade de itens
		var caux = id1.split("orcCodProdutoItem___").pop();
		if(parseInt(caux)>indice){		
			indice = parseInt(caux);
			
		}
		
	}
		
	var straux = "";
	
	var campos = hAPI.getCardData(getValue("WKNumProces"));
	for (var j=1;j<=indice;j++){
		
		var contador = campos.keySet().iterator();
		var _e = locator.createLISTA(); //_e eh um STREG
		straux = "";
		var orcCodProdutoItem = "";	
		var orcQtdItem = "";
		var orcPrecoTabelaItem = "";
		var orcPrecoUnitItem = "";
		var orcTotalItem = "";
		var desconto = 0;
		var comissao = 0;
		
		
		while (contador.hasNext()) {
			var id = contador.next();
			//item 1
			log.info('id.trim()='+id.trim())
			if (id.trim() == 'orcCodProdutoItem___'+j){
				orcCodProdutoItem = campos.get(id).trim();
			}
			log.info('orcCodProdutoItem->->'+orcCodProdutoItem)
			//item 2
			if (id.trim() == 'orcQtdItem___'+j){
				orcQtdItem = campos.get(id).trim();
			}
			//item 3 
			if (id.trim() == 'orcPrecoTabelaItem___'+j){
				orcPrecoTabelaItem = campos.get(id).trim();
			}
			//item 4 
			if (id.trim() == 'orcPrecoCustoItem___'+j){
				orcPrecoUnitItem = campos.get(id).trim();
			}
			//item 5
			if (id.trim() == 'orcTotalCustoItem___'+j){
				orcTotalItem = campos.get(id).trim();
				  			  
			}

		}//final do while
		//1-orcCodProdutoItem 			2-orcQtdItem	3-orcPrecoTabelaItem 	4-orcPrecoUnitItem		5-orcTotalItem	5desconto		
		straux = orcCodProdutoItem +";"+ orcQtdItem +";"+orcPrecoTabelaItem+";"+ orcPrecoUnitItem +";"+ orcTotalItem +";0;0";
		log.info("straux -> " + straux);
		
		_e.setDADOS(straux);
		_b.add(_e);
		_e = null;	
	}

	_a.setREGISTROS(_c);
	
	
//	A1COD, A1LOJA,CONDPG,TABPRECO,OBSORC,PERCDESC,_DADOS
	var A1COD = new String(hAPI.getCardValue("A1_COD"));
	var A1LOJA = new String(hAPI.getCardValue("A1_LOJA"));
	var CONDPG = new String(hAPI.getCardValue("codCondPagto"));
	var TIPOPEDIDO = new String(hAPI.getCardValue("tipoPedido"));
	var IDFLUIG = getValue('WKNumProces');
	var TABPRECO = '011'; 
	var OBSORC = '';
	var PERCDESC = '0';
	
	 log.info('IDFLUIG->'+IDFLUIG);
	 log.info('straux->'+straux);
	 log.info('_a->'+_a);
	try{
    	ProtheusService.cadastraorcamento(  A1COD ,
											A1LOJA,
											CONDPG,
											TABPRECO,
											OBSORC,
											PERCDESC,
											TIPOPEDIDO,
											IDFLUIG,
											_a);//metodo   

	    log.info("Orçamento criado");

    }catch(e){    
    	log.info("Orçamento: deu erro na geração do Orçamento no protheus: " + e);
    	throw("Erro " + e);
    };
	
}

function servicetask39(attempt, message) {

	/*
	 * Pega o email que esta no Fluig do gerente da revenda pelo campo gerenteRevenda
	 * 
	 */
	var WKCompany = getValue("WKCompany")
	var WKUserGerente =  hAPI.getCardValue('gerenteRevenda');
	var c1 = DatasetFactory.createConstraint("colleaguePK.companyId", WKCompany, WKCompany, ConstraintType.MUST);
	var c2 = DatasetFactory.createConstraint("colleaguePK.colleagueId", WKUserGerente, WKUserGerente, ConstraintType.MUST);

	var colunasColleague = new Array('mail','colleagueName');
	var datasetColleague = DatasetFactory.getDataset('colleague', colunasColleague, new Array(c1, c2), null);

	/*
	 * Passa as constraints para o dataset, para que seja possível
	 */
	var paraTo = datasetColleague.getValue(0, "mail");
	var numPedido = hAPI.getCardValue('numPedido');
	var idFluig = getValue('WKNumProces');
	var gestorEstado = hAPI.getCardValue('gestorEstado');


	if(paraTo != ""){
		var c1 = DatasetFactory.createConstraint("paraTo", paraTo, paraTo, ConstraintType.MUST);
		var c2 = DatasetFactory.createConstraint("numPedido", numPedido, numPedido, ConstraintType.MUST);
		var c3 = DatasetFactory.createConstraint("idFluig", idFluig, idFluig, ConstraintType.MUST);
		var c4 = DatasetFactory.createConstraint("gestorEstado", gestorEstado, gestorEstado, ConstraintType.MUST);


		var constraints = new Array(c1, c2, c3, c4);
		var dataset = DatasetFactory.getDataset("dsEnviaEmailPedidoCriado", [], constraints, []);
		var envioOK = '';
		for (var i = 0; i < dataset.rowsCount; i++) {
			envioOK = dataset.getValue(i, "COK");
		}

		if(envioOK == ''){
			throw 'Não enviou o email do pedido de venda';
		}
	}else{
		throw 'Não encontrou o email do gerente da revenda';
	}

}
